import React from "react"
import Delayed from './Delayed';
import './App.css';

function ErrorMessage(props) {

    if (props.render == false) {
        return;
    } 

    const Spinner = () => (
        <React.Fragment>
          <svg class="spinner" width="50" height="50" viewBox="0 0 100 100">
            <circle class="background" r="24" cx="50" cy="50"></circle>
            <path
              class="line"
              d="M 37.5,50 C 37.5,43.096441 43.096441,37.5 50,37.5 C 56.903559,37.5 62.5,43.096441 62.5,50 C 62.5,56.903559 56.903559,62.5 50,62.5 C 43.096441,62.5 37.5,56.903559 37.5,50"
            ></path>
          </svg>
        </React.Fragment>
    )

    const CheckBox = () => {


        return (
        <React.Fragment>
            <svg class="crossmark addClass" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 52 52" >
  <circle class="crossmark__circle addClass" cx="26" cy="26" r="25" fill="none"/>
      <circle class="loader-path" cx="26" cy="26" r="17" fill="none" stroke="#ffffff" stroke-width="3" />
    </svg>
        </React.Fragment>
    )}

    function check (num) {
        for (let i = 0; i < num; i ++) {
            for (let j = 0; j < num; j ++) {
                console.log("Computing...");
            }
        }
    }

    return (
        <div>
            <div className='message'>

                    <CheckBox />

                <span className="messageText">{props.message}</span>
            </div>

        </div>   

    )

};

export default ErrorMessage;
